const products = [
  {
    id: 2,
    name: "Green Flower",
    href: "#",
    imageSrc:
      "https://media.zid.store/bda63855-f7ff-4be7-bd9f-1d497a22336c/f781efce-7be4-4894-8b34-0b29ff7e297b.png",
    imageAlt: "Front of men's Basic Tee in black.",
    price: "193.00 ر.س",
